import axios from "axios";
import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
const Portal = () => {
    const navigate = useNavigate()
    const [alunoInfo, setAluoinfo] = useState([])
    const [numero, setNumero] = useState(5)
    useEffect(() => {
        const id = localStorage.getItem('IdAluno')
        axios.get(`http://localhost:3001/getAlunoInfo/${id}`).then((response) => {
            if (response.data) {
                setAluoinfo(response.data)
            } else {
                setAluoinfo('Erro')
            }
        })
        cor()
    })
    function cor() {
        const span1 = document.querySelector('.e1')
        const span2 = document.querySelector('.e2')
        const span3 = document.querySelector('.e3')
        const span4 = document.querySelector('.e4')
        const span5 = document.querySelector('.e5')
        const span6 = document.querySelector('.e6')
        const span7 = document.querySelector('.e7')
        const span8 = document.querySelector('.e8')
        const span9 = document.querySelector('.e9')
        const span10 = document.querySelector('.e10')
        const span11 = document.querySelector('.e11')
        const span12 = document.querySelector('.e12')

        try {
            if (alunoInfo.portugues < 5) {
                span1.classList.add('ruim')
            } else {
                span1.classList.add('bom')
            }
        } catch (error) {
            return
        }


        try {
            if (alunoInfo.matematica < 5) {
                span2.classList.add('ruim')
            } else {
                span2.classList.add('bom')
            }
        } catch (error) {
            return
        }

        try {
            if (alunoInfo.historia < 5) {
                span3.classList.add('ruim')
            } else {
                span3.classList.add('bom')
            }
        } catch (error) {
            return
        }

        try {
            if (alunoInfo.geografia < 5) {
                span4.classList.add('ruim')
            } else {
                span4.classList.add('bom')
            }
        } catch (error) {
            return
        }

        try {
            if (alunoInfo.nota_fisica < 5) {
                span5.classList.add('ruim')
            } else {
                span5.classList.add('bom')
            }
        } catch (error) {
            return
        }

        try {
            if (alunoInfo.biologia < 5) {
                span6.classList.add('ruim')
            } else {
                span6.classList.add('bom')
            }
        } catch (error) {
            return
        }

        try {
            if (alunoInfo.quimica < 5) {
                span7.classList.add('ruim')
            } else {
                span7.classList.add('bom')
            }
        } catch (error) {
            return
        }

        try {
            if (alunoInfo.redes < 5) {
                span8.classList.add('ruim')
            } else {
                span8.classList.add('bom')
            }
        } catch (error) {
            return
        }

        try {
            if (alunoInfo.imc < 5) {
                span9.classList.add('ruim')
            } else {
                span9.classList.add('bom')
            }
        } catch (error) {
            return
        }

        try {
            if (alunoInfo.ltp < 5) {
                span10.classList.add('ruim')
            } else {
                span10.classList.add('bom')
            }
        } catch (error) {
            return
        }

        try {
            if (alunoInfo.Aps < 5) {
                span11.classList.add('ruim')
            } else {
                span11.classList.add('bom')
            }
        } catch (error) {
            return
        }

        try {
            if (alunoInfo.seg < 5) {
                span12.classList.add('ruim')
            } else {
                span12.classList.add('bom')
            }
        } catch (error) {
            return
        }

    }
    function logout() {
        localStorage.removeItem('token')
        localStorage.removeItem('idAluno')
        navigate('/')
    }
    return (

        <>  <center>

            <table class="GeneratedTable">
                <thead>
                    <tr>
                    <th>UNIDADE</th>
                        
                        <th>Portugues</th>
                        <th>Matematica</th>
                        <th>Historia</th>
                        <th>Fisica</th>
                        <th>BIologia</th>
                        <th>quimica</th>
                        <th>Redes</th>
                        <th>IMC</th>
                        <th>LTP</th>
                        <th>APS</th>
                        <th>Segurança de sistema</th>



                    </tr>
                </thead>
                <tbody>
                    <tr>
                        <td>{alunoInfo.portugues === null ? <>Não definido</> : <><span className="e1">{alunoInfo.portugues}</span></>}</td>
                        <td>{alunoInfo.matematica === null ? <>Não definido</> : <> <span className="e2">{alunoInfo.matematica}</span></>}</td>
                        <td>{alunoInfo.historia === null ? <>Não definido</> : <> <span className="e2">{alunoInfo.historia}</span></>}</td>
                        <td>{alunoInfo.nota_fisica === null ? <>Não definido</> : <> <span className="e2">{alunoInfo.nota_fisica}</span></>}</td>
                        <td>{alunoInfo.biologia === null ? <>Não definido</> : <> <span className="e2">{alunoInfo.biologia}</span></>}</td>
                        <td>{alunoInfo.quimica === null ? <>Não definido</> : <> <span className="e2">{alunoInfo.quimica}</span></>}</td>
                        <td>{alunoInfo.redes === null ? <>Não definido</> : <> <span className="e2">{alunoInfo.redes}</span></>}</td>
                        <td>{alunoInfo.imc === null ? <>Não definido</> : <> <span className="e2">{alunoInfo.imc}</span></>}</td>
                        <td>{alunoInfo.ltp === null ? <>Não definido</> : <> <span className="e2">{alunoInfo.ltp}</span></>}</td>
                        <td>{alunoInfo.Aps === null ? <>Não definido</> : <> <span className="e2">{alunoInfo.Aps}</span></>}</td>
                        <td>{alunoInfo.seg === null ? <>Não definido</> : <> <span className="e2">{alunoInfo.seg}</span></>}</td>
                        <td>I Unidade</td>
                        
                    </tr>
                    <tr>
                    <td>{alunoInfo.portugues2 === null ? <>Não definido</> : <> <span className="e1">{alunoInfo.portugues2}</span></>}</td>
                        <td>{alunoInfo.matematica2 === null ? <>Não definido</> : <> <span className="e2">{alunoInfo.matematica2}</span></>}</td>
                        <td>{alunoInfo.historia2 === null ? <>Não definido</> : <> <span className="e2">{alunoInfo.historia2}</span></>}</td>
                        <td>{alunoInfo.nota_fisica2 === null ? <>Não definido</> : <> <span className="e2">{alunoInfo.nota_fisica2}</span></>}</td>
                        <td>{alunoInfo.biologia2 === null ? <>Não definido</> : <> <span className="e2">{alunoInfo.biologia2}</span></>}</td>
                        <td>{alunoInfo.quimica2 === null ? <>Não definido</> : <> <span className="e2">{alunoInfo.quimica2}</span></>}</td>
                        <td>{alunoInfo.redes2 === null ? <>Não definido</> : <> <span className="e2">{alunoInfo.redes2}</span></>}</td>
                        <td>{alunoInfo.imc2 === null ? <>Não definido</> : <> <span className="e2">{alunoInfo.imc2}</span></>}</td>
                        <td>{alunoInfo.ltp2 === null ? <>Não definido</> : <> <span className="e2">{alunoInfo.ltp2}</span></>}</td>
                        <td>{alunoInfo.Aps2 === null ? <>Não definido</> : <> <span className="e2">{alunoInfo.Aps2}</span></>}</td>
                        <td>{alunoInfo.seg2 === null ? <>Não definido</> : <> <span className="e2">{alunoInfo.seg2}</span></>}</td>
                        <td>II Unidade</td>
                        
                    </tr>
                    <tr>
                    <td>{alunoInfo.portugues3 === null ? <>Não definido</> : <> <span className="e1">{alunoInfo.portugues3}</span></>}</td>
                        <td>{alunoInfo.matematica3 === null ? <>Não definido</> : <> <span className="e2">{alunoInfo.matematica3}</span></>}</td>
                        <td>{alunoInfo.historia3 === null ? <>Não definido</> : <> <span className="e2">{alunoInfo.historia3}</span></>}</td>
                        <td>{alunoInfo.nota_fisica3 === null ? <>Não definido</> : <> <span className="e2">{alunoInfo.nota_fisica3}</span></>}</td>
                        <td>{alunoInfo.biologia3 === null ? <>Não definido</> : <> <span className="e2">{alunoInfo.biologia3}</span></>}</td>
                        <td>{alunoInfo.quimica3 === null ? <>Não definido</> : <> <span className="e2">{alunoInfo.quimica3}</span></>}</td>
                        <td>{alunoInfo.redes3 === null ? <>Não definido</> : <> <span className="e2">{alunoInfo.redes3}</span></>}</td>
                        <td>{alunoInfo.imc3 === null ? <>Não definido</> : <> <span className="e2">{alunoInfo.imc3}</span></>}</td>
                        <td>{alunoInfo.ltp3 === null ? <>Não definido</> : <> <span className="e2">{alunoInfo.ltp3}</span></>}</td>
                        <td>{alunoInfo.Aps3 === null ? <>Não definido</> : <> <span className="e2">{alunoInfo.Aps3}</span></>}</td>
                        <td>{alunoInfo.seg3 === null ? <>Não definido</> : <> <span className="e2">{alunoInfo.seg3}</span></>}</td>
                        <td>III Unidade</td>
                        
                    </tr>
                </tbody>
            </table>
       


        </center >
            <button className="logout" onClick={logout}>Fazer Logout</button>

        </>



    )

}
export default Portal
